export default function Feed({data, type}) { //type can be used to switch update/news
    const cards = data || Array(20).fill({})
    const grid = `w-full overflow-x-scroll grid grid-cols-${users.length} col-gap-0 no-scrollbar grid-flow-col no-wrap`
    return(
        <div className={grid}>
            <FeedCard />
            <FeedCard />
            <FeedCard />
            <FeedCard />
        </div>
    )
}
